import React from "react";
import banner from "../../Images/slider-Banner.jpg"

function Banner() {
  return (
    <article className="container" page-content>
      <section className="banner" aria-label="popular movies">
        <div className="banner-slider">
          <div className="slider-item active" slider-item>
            <img src={banner} alt="Marvel" className="img-cover"/>
          </div>
        </div>
      </section>
    </article>
  );
}

export default Banner;
